const Details = () => {
    return (
        <>
            <nav style = {{display: 'flex', 
            background:'green', 
            color:'whitesmoke',
            textDecoration:'none',
            justifyContent: 'space-around'
            }}>
                <Link href={'/'}><a>Home</a></Link>
                <Link href={'/details'}><a>Skills Details</a></Link>
            </nav>
                <h1>Skill Details</h1>
        </>
    )
}

export default Details;
